function Login() {
  return (
    // <body onLoad='Login.focus()'>
    // <body>
    <div className='img'>
      <meta name="viewport" content="width=device-width,initial-scale=1"/>

    <div className='suvi'>
      Space Energy Systems
    </div> 
    <div className="main" >
     <div className="intro">
      
        <h1>EVERYTHING EASY AND ECONOMICAL</h1>
        <p>Construction application that gets you easy access to building information, create plan, schedule, resources, material and related services at your fingertips.</p>
      
     </div>
     
    <div className='frame'>
     <div className="sub-main">
       
         <div >
         <div className='title-logo'>
         <img src={logo} alt="logo" className="logo-pic"/>
         </div>
         <div>
         <form name='form1' >
          
           <div>
             <img src={email} alt="email"  className="email-pic"/>
             <input type="text" name="email1" placeholder="Email" className="name"/><br></br>
           </div>
           <div className="second-input">
             <img src={pass} alt="pass" className="email-pic"/>
             <input type="password" placeholder="4-digit pin" className="name" pattern='^\d{4}$'/><br></br>
           </div>
          <br></br>
          {/* <div className='button'> */}
          <button >Login</button>
          {/* <input type="submit" name="Login" value="Login" onclick="Validate(document.form1.email1)"/>
          </div> */}
          </form>
       </div> 
           <p >
              <a href="#" className='link'>Forgot pin?</a> 
              <br></br>
              <a href="/signup" >Sign Up</a>
            </p>
            <br></br>
           
           
         </div>
       
       
         </div>
      </div> 
      
    </div>
    
    </div>
